	<nav class="navbar black-bg navbar-expand-md navbar-dark">
    <button class="navbar-toggler ml-auto justify-content-end" type="button" data-toggle="collapse" data-target="#collapsingNavbar" aria-controls="#collapsingNavbar" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse background-c align-items-center" id="collapsingNavbar">

	<ul>
	<li><a href="#">Home</a></li>
	<li><a href="#">News</a></li>
	<li><a href="#">Destination</a></li>
	<li><a href="#">Blog</a></li>
	<li><a href="#">Contact</a></li>
	</ul>

    </div>
  </nav>
















	)
}


export default Navbar;
